      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN col1 * - + col2 * + 47 AND + 40 / + - ( - + 41 ) * + + col2 + + ( col0 ) + - + col2 / 86;
  - name: tab1

outputs:
  - name: q6572.out
    data: |
